import './App.scss';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import NavBar from './0_NavBar/navbar';
import Intro from './1a_Intro/intro';
import About from './1b_About/about';
import Projects from './1c_Projects/projects';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>

          <Route exact path="/" component={Intro} />

          <NavBar />
          <Route exact path="/About" component={About}/>
          <Route exact path="/Projects" component={Projects}/>
          <Route component={Default} />

        </Switch>
      </Router>
    </div>
  );
}

const Splash = () => (
  <div>

  </div>
)

const Default = () => (
  <div>

  </div>
)

export default App;
